  vcd_write_def(sim_hdl, bk_clock_vcd_num(sim_hdl, __clk_handle_0), "CLK", 1u);
  vcd_write_def(sim_hdl, num++, "RST_N", 1u);
  vcd_set_clock(sim_hdl, num, __clk_handle_0);
  vcd_write_def(sim_hdl, num++, "hwmain_inputBufferCnt_99_EQ_3___d200", 1u);
  vcd_set_clock(sim_hdl, num, __clk_handle_0);
  vcd_write_def(sim_hdl, num++, "hwmain_outputBufferCnt_28_EQ_0___d229", 1u);
  vcd_set_clock(sim_hdl, num, __clk_handle_0);
  vcd_write_def(sim_hdl, num++, "v__h303", 32u);
  vcd_set_clock(sim_hdl, num, __clk_handle_0);
  vcd_write_def(sim_hdl, num++, "x__h4112", 2u);
  vcd_set_clock(sim_hdl, num, __clk_handle_0);
  vcd_write_def(sim_hdl, num++, "x__h4144", 2u);
  num = INST_hwmain_floatAdder_calcQ.dump_VCD_defs(num);
  num = INST_hwmain_floatAdder_inProcQ.dump_VCD_defs(num);
  num = INST_hwmain_floatAdder_inQ.dump_VCD_defs(num);
  num = INST_hwmain_floatAdder_normalizeQ.dump_VCD_defs(num);
  num = INST_hwmain_floatAdder_normalizeQ1.dump_VCD_defs(num);
  num = INST_hwmain_floatAdder_normalizeQ2.dump_VCD_defs(num);
  num = INST_hwmain_floatAdder_normalizeQ3.dump_VCD_defs(num);
  num = INST_hwmain_floatAdder_normalizeQ4.dump_VCD_defs(num);
  num = INST_hwmain_floatAdder_outQ.dump_VCD_defs(num);
  num = INST_hwmain_floatMultiplier_multQ.dump_VCD_defs(num);
  num = INST_hwmain_floatMultiplier_outQ.dump_VCD_defs(num);
  num = INST_hwmain_floatMultiplier_signExpZeroQ.dump_VCD_defs(num);
  num = INST_hwmain_floatingQ.dump_VCD_defs(num);
