void MOD_mkBsvTop_bsim::dump_VCD(tVCDDumpType dt, unsigned int levels, MOD_mkBsvTop_bsim &backing)
{
  vcd_defs(dt, backing);
  vcd_prims(dt, backing);
}

void MOD_mkBsvTop_bsim::vcd_defs(tVCDDumpType dt, MOD_mkBsvTop_bsim &backing)
{
  unsigned int num = vcd_num;
  if (dt == VCD_DUMP_XS)
  {
    vcd_write_x(sim_hdl, num++, 1u);
    vcd_write_x(sim_hdl, num++, 1u);
    vcd_write_x(sim_hdl, num++, 1u);
    vcd_write_x(sim_hdl, num++, 32u);
    vcd_write_x(sim_hdl, num++, 2u);
    vcd_write_x(sim_hdl, num++, 2u);
  }
  else
    if (dt == VCD_DUMP_CHANGES)
    {
      if ((backing.PORT_RST_N) != PORT_RST_N)
      {
	vcd_write_val(sim_hdl, num, PORT_RST_N, 1u);
	backing.PORT_RST_N = PORT_RST_N;
      }
      ++num;
      if ((backing.DEF_hwmain_inputBufferCnt_99_EQ_3___d200) != DEF_hwmain_inputBufferCnt_99_EQ_3___d200)
      {
	vcd_write_val(sim_hdl, num, DEF_hwmain_inputBufferCnt_99_EQ_3___d200, 1u);
	backing.DEF_hwmain_inputBufferCnt_99_EQ_3___d200 = DEF_hwmain_inputBufferCnt_99_EQ_3___d200;
      }
      ++num;
      if ((backing.DEF_hwmain_outputBufferCnt_28_EQ_0___d229) != DEF_hwmain_outputBufferCnt_28_EQ_0___d229)
      {
	vcd_write_val(sim_hdl, num, DEF_hwmain_outputBufferCnt_28_EQ_0___d229, 1u);
	backing.DEF_hwmain_outputBufferCnt_28_EQ_0___d229 = DEF_hwmain_outputBufferCnt_28_EQ_0___d229;
      }
      ++num;
      if ((backing.DEF_v__h303) != DEF_v__h303)
      {
	vcd_write_val(sim_hdl, num, DEF_v__h303, 32u);
	backing.DEF_v__h303 = DEF_v__h303;
      }
      ++num;
      if ((backing.DEF_x__h4112) != DEF_x__h4112)
      {
	vcd_write_val(sim_hdl, num, DEF_x__h4112, 2u);
	backing.DEF_x__h4112 = DEF_x__h4112;
      }
      ++num;
      if ((backing.DEF_x__h4144) != DEF_x__h4144)
      {
	vcd_write_val(sim_hdl, num, DEF_x__h4144, 2u);
	backing.DEF_x__h4144 = DEF_x__h4144;
      }
      ++num;
    }
    else
    {
      vcd_write_val(sim_hdl, num++, PORT_RST_N, 1u);
      backing.PORT_RST_N = PORT_RST_N;
      vcd_write_val(sim_hdl, num++, DEF_hwmain_inputBufferCnt_99_EQ_3___d200, 1u);
      backing.DEF_hwmain_inputBufferCnt_99_EQ_3___d200 = DEF_hwmain_inputBufferCnt_99_EQ_3___d200;
      vcd_write_val(sim_hdl, num++, DEF_hwmain_outputBufferCnt_28_EQ_0___d229, 1u);
      backing.DEF_hwmain_outputBufferCnt_28_EQ_0___d229 = DEF_hwmain_outputBufferCnt_28_EQ_0___d229;
      vcd_write_val(sim_hdl, num++, DEF_v__h303, 32u);
      backing.DEF_v__h303 = DEF_v__h303;
      vcd_write_val(sim_hdl, num++, DEF_x__h4112, 2u);
      backing.DEF_x__h4112 = DEF_x__h4112;
      vcd_write_val(sim_hdl, num++, DEF_x__h4144, 2u);
      backing.DEF_x__h4144 = DEF_x__h4144;
    }
}

